        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        flexDirection: 'column'
    }
    console.log('FirstPage!');
    return (
        <div style={StyleSheet}>
            Mathced:{props.match.params.id}
            <Link to='/'>點我到第一頁</Link>
            <h1 style={{color:'white', fontFamily:'Microsoft JhengHei'}}>我是第一頁</h1>
        </div>
    )
}

export default FirstPage;
